import React from 'react';
import Imgbac from './bac1.jpg';
import ImgAtt from './AttLP.jpg';
import ImgDip from './dip.jpg';
import imgd from '../../../../images/person1.jpg'

export default function Details(ImgF) {

    switch (ImgF){
    case "f0":  
        ImgF=Imgbac;
        break;
    case "f1":
        ImgF=ImgAtt;
        break;
    case "f2":
        ImgF=ImgDip;
    default:
        ImgF=imgd;
    }
    return (
            <div className='card'>
                <div className='card-image'>
                    <img className='activator' src={ImgF} alt='BAC' />
                </div>
            </div>
        ) ;
}
